import React, {Component} from 'react';
import './App.css';
import Todos from "./components/Todos";

class App extends Component {

  state = {
    todos: [
      {
        id: 1,
        titile: 'Take out the trash',
        completed: false
      },
      {
        id: 2,
        titile: 'learn react',
        completed: false
      },
      {
        id: 3,
        titile: 'learn data structure and algo',
        completed: false
      }
    ]
  }
  render() {
    return (
        <div className="App">
          <Todos todos={this.state.todos}/>
        </div>
    );
  }

}
export default App;
